import React from 'react';
import { motion } from 'framer-motion';
import { ChevronDown, Download, Mail } from 'lucide-react';

const Hero: React.FC = () => {
  const scrollToAbout = () => {
    const element = document.querySelector('#about');
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <section id="home" className="min-h-screen flex items-center justify-center relative bg-gradient-to-br from-primary-50 to-secondary-50 dark:from-dark-900 dark:to-dark-950">
      <div className="container-max section-padding">
        <div className="text-center max-w-4xl mx-auto">
          {/* Profile Image */}
          <img
            src="/Profile_Image.jpg"
            alt="Alec McCutcheon profile"
            className="w-36 h-36 rounded-full mx-auto mb-8 shadow-lg border-4 border-white dark:border-dark-800 object-cover"
          />
          {/* Main Heading */}
          <motion.h1
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            className="text-5xl md:text-7xl font-bold text-secondary-900 dark:text-white mb-6"
          >
            Hi, I'm{' '}
            <span className="gradient-text">Alec McCutcheon</span>
          </motion.h1>

          {/* Subtitle */}
          <motion.p
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
            className="text-xl md:text-2xl text-secondary-600 dark:text-secondary-300 mb-8"
          >
            Certified IT Specialist · PowerShell Programmer · Automation Engineer · Tier 1–3 Support
          </motion.p>

          {/* Description */}
          <motion.p
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
            className="text-lg text-secondary-500 dark:text-secondary-400 mb-12 max-w-3xl mx-auto"
          >
            Certified IT Specialist, seasoned PowerShell programmer, and experienced Tier 1–3 support technician. I specialize in automation, scripting, and RMM migration, developing custom solutions that streamline business operations and solve unique client challenges. My background spans system administration, technical support, and freelance work in PowerShell scripting and web design. Outside of client projects, I enjoy exploring new technologies—dabbling in React, Flutter, and integrating AI into my workflow to stay at the forefront of innovation.
          </motion.p>

          {/* CTA Buttons */}
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.6 }}
            className="flex flex-col sm:flex-row gap-4 justify-center items-center mb-16"
          >
            <button className="btn-primary flex items-center gap-2">
              <Download size={20} />
              Download Resume
            </button>
            <button className="btn-secondary flex items-center gap-2">
              <Mail size={20} />
              Get In Touch
            </button>
          </motion.div>

          {/* Scroll Indicator */}
          <motion.div
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 0.8, delay: 1 }}
            className="flex justify-center"
          >
            <button
              onClick={scrollToAbout}
              className="flex flex-col items-center text-secondary-400 dark:text-secondary-500 hover:text-primary-600 dark:hover:text-primary-400 transition-colors duration-200"
            >
              <span className="text-sm mb-2">Learn More</span>
              <motion.div
                animate={{ y: [0, 10, 0] }}
                transition={{ duration: 2, repeat: Infinity }}
              >
                <ChevronDown size={24} />
              </motion.div>
            </button>
          </motion.div>
        </div>
      </div>

      {/* Background Elements */}
      <div className="absolute inset-0 overflow-hidden pointer-events-none">
        {/* Existing balls (light and dark mode) */}
        <div className="absolute top-20 left-10 w-72 h-72 bg-primary-200 dark:bg-primary-900/30 rounded-full mix-blend-multiply filter blur-xl opacity-70 animate-bounce-slow"></div>
        <div className="absolute top-40 right-10 w-72 h-72 bg-secondary-200 dark:bg-secondary-800/30 rounded-full mix-blend-multiply filter blur-xl opacity-70 animate-bounce-slow" style={{ animationDelay: '1s' }}></div>
        <div className="absolute -bottom-8 left-20 w-72 h-72 bg-primary-300 dark:bg-primary-800/30 rounded-full mix-blend-multiply filter blur-xl opacity-70 animate-bounce-slow" style={{ animationDelay: '2s' }}></div>
        {/* Extra vibrant balls for dark mode only */}
        <div className="hidden dark:block absolute top-10 right-1/3 w-80 h-80 bg-indigo-700/40 rounded-full mix-blend-screen filter blur-2xl opacity-80 animate-bounce-slow" style={{ animationDelay: '0.5s' }}></div>
        <div className="hidden dark:block absolute bottom-10 left-1/4 w-96 h-96 bg-purple-700/40 rounded-full mix-blend-screen filter blur-2xl opacity-70 animate-bounce-slow" style={{ animationDelay: '1.5s' }}></div>
        <div className="hidden dark:block absolute top-1/2 right-24 w-72 h-72 bg-teal-500/30 rounded-full mix-blend-screen filter blur-2xl opacity-60 animate-bounce-slow" style={{ animationDelay: '2.5s' }}></div>
        <div className="hidden dark:block absolute bottom-0 right-1/3 w-64 h-64 bg-blue-600/30 rounded-full mix-blend-screen filter blur-2xl opacity-60 animate-bounce-slow" style={{ animationDelay: '3s' }}></div>
      </div>
    </section>
  );
};

export default Hero;
